import React, { Component } from "react";

class Content extends Component {
    render() {
        var lists = [];
        var data = this.props.data;
        var i =0;
        while(i<data.length){
            lists.push(<li><a href="#">{data[i]}</a></li>);
            i += 1;
        }

        return (
            <nav>
                <ul>
                    <li><a href="#">HTML</a></li>
                    <li><a href="#">CSS</a></li>
                    <li><a href="#">JavaScript</a></li>
                </ul>
            </nav>
        )
    }
}

export default Content;
